__HTML_LATENCY_CHART = r'''<div style="font-family:arial; font-size:75%%; min-width: 310px; margin: 0 auto">
      <h1>Latency</h1>
    </div>
    <svg id="latency" style="min-width: 310px; height: 700px; margin: 0 auto"></svg>
    <script>
      var latencyData = %s

      var latencyChart

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#latency')
          latencyChart = nv.models.lineWithFocusChart()
          latencyChart
            .width(svg.attr('width'))

          latencyChart.xScale(d3.scale.log())

          latencyChart.xAxis
            .tickFormat(function(d) {
              if (d == null) {
                return 'N/A'
              }

              if (d > 999) {
                return d3.format(',.0f')(d/1000) + 'k'
              }

              if (d < 1000 && d > 0.999) {
                return d3.format(',.0f')(d)
              }

              if (d < 1 && d > 0.0999) {
                return  d3.format(',.1f')(d)
              }

              if (d < 0.1 && d > 0.00999) {
                return d3.format(',.2f')(d)
              }

              return d3.format(',.3f')(d)
            })
            .axisLabel("time, ms")
            .showMaxMin(false)

          latencyChart.xAxis
            .axisLabel("time, ms")
            .showMaxMin(false)

          latencyChart.yAxis
            .axisLabel("count, %%")
            .showMaxMin(false)

          svg.datum(latencyData).call(latencyChart)

          return latencyChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#latency')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })
    </script>'''

